import React, { Component } from "react";
import Videoplayer from "./videoplayer"
import SearchList from "./searchlist"
import { connect } from "react-redux";
import { fetchVideos } from '../actions/actions';
import { bindActionCreators } from 'redux';
import LandingPage from "./landingpage";
import { Route, Link } from "react-router-dom";


class Home extends Component {

    state = {
        title: ""
    }

    handleOnSubmit = (e) => {
        e.preventDefault()
        this.props.fetchVideos(this.state.title)
    }

    render() {
        return (
            <div>
                <nav className="navbar-fixed">
                <div className="d-flex flex-col navBar py-2">
                 <i className="fa fa-bars mt-2 ml-4 text-white"></i>
                 <i className="fa fa-youtube-play ml-4 fa-2x text-danger"></i>
                 <strong className='m-1 text-white'>YouTube</strong>
                 <span className="text-secondary mt-1" style={{"fontSize":"8px"}}>IN</span>
                    <input className="offset-md-2 col-md-4 searchInp" onChange={(elem) => this.setState({ title: elem.target.value })} type="search" placeholder="Search"></input>
                <button className="px-4 searchBtn" onClick={this.handleOnSubmit}> <Link to="/home/search"><i className="fa fa-search text-secondary" aria-hidden="true"></i></Link> </button>
                <i className="fa fa-video-camera mt-2 offset-md-2 text-white"></i><i className="fa fa-th mt-2 ml-5 text-white"></i><i className="fa fa-bell mt-2 ml-5 text-white"></i>
                </div>
                </nav>

                <Route path="/home/search" exact>
                    <SearchList />
                </Route>
                <Route path="home/video" exact> 
                    <Videoplayer />
                </Route>
                <Route path="/home" exact>
                    <LandingPage />
                </Route>

            </div>
        )
    }

}
const mapStateToProps = (state) => {
    console.log("player state", state)
    return {
    }
}

const mapDispatchToProps = (dispatch) => {
    return bindActionCreators({ fetchVideos }, dispatch)
}


export default connect(mapStateToProps, mapDispatchToProps)(Home)
